(52, 27, '<ul><li><span style="font-size: 18px;"><font color="#085294">Precision moulded from low friction polypropylene.</font></span></li><li><span style="font-size: 18px;"><font color="#085294">Allow unrestricted thermal movement.</font></span></li><li><span style="font-size: 18px;"><font color="#085294">Smooth profile eliminates abrasive wear of pipe.</font></span></li><li><span style="font-size: 18px;"><font color="#085294">Low cost & quick, simple installation saves time & money.</font></span></li><li><span style="font-size: 18px;"><font color="#085294">Durable polypropylene avoids unsightly corrosion damage.</font></span></li><li><span style="font-size: 18px;"><font color="#085294">Matching spacers for perfect alignment of pipes & valves.</font></span></li><li><span style="font-size: 18px;"><font color="#085294">Components interlock for neat & effective space utilisation</font></span></li></ul>'),
