(58, 133, '<p><span style="font-size: 14px;"><font color="#085294">Full bore magnetic flowmeters have no internal moving parts or obstructions to cause pressure drops across the meter or require maintenance for cleaning or repair. Remote mounted convertors are supplied with IP65 protection as standard. Explosion proof, IP67 or IP68 enclosures are optional. They are available with AC or DC power options. A variety of liner, electrode & construction materials are available to build units for water, waste water, food & pharmaceutical applications as well as units for the mining & mineral processing industries for the handling of slurries & corrosive fluids.</font></span></p><p><span style="font-size: 14px;"><font color="#085294"> Ideal for flowmeters mounted in pits liable to flood.</font></span></p><p><span style="font-size: 14px;"><font color="#085294"> Power supply 85— 250V, 45— 63 Hz, single phase.</font></span></p><p><span style="font-size: 14px;"><font color="#085294"> Or nominal 24VDC supply, range 20—36 VDC.</font></span></p><p><span style="font-size: 14px;"><font color="#085294"> Power consumption including sensor, 20 Watts.</font></span></p><p><span style="font-size: 14px;"><font color="#085294"> Ambient temperature operating range, -10—+60oC</font></span></p><p><span style="font-size: 14px;"><font color="#085294"> Relative humidity: 5% - 90%.</font></span></p>'),
(59, 134, '<p><span style="font-size: 18px;"><font color="#085294">Insertion magnetic flowmeters have no internal moving parts or obstructions to cause pressure drops across the meter or require maintenance for cleaning or repair. They can be supplied with either integral or remote mounted convertors with IP65 protection as standard. Explosion proof, IP67 or IP68 enclosures are optional. They are available with AC or DC power options. A cost effective solution for the larger pipe sizes found in water, waste water, food & pharmaceutical applications as well as units for the mining & mineral processing industries for the handling of slurries & corrosive fluids.</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Low cost installation for larger pipe sizes.</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Easily moved from one installation to another.</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Suitable for pipe diameters DN100 to DN3000.</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Integral converters or remote mount.</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Minimum flow velocity 0.5 m/s</font></span></p>'),
(60, 135, '<p><span style="font-size: 18px;"><font color="#085294">Full bore magnetic flowmeters have no internal moving parts or obstructions to cause pressure drops across the meter or require maintenance for cleaning or repair. They can be supplied with either integral or remote mounted convertors with IP65 protection as standard. Explosion proof, IP67 or IP68 enclosures are optional. They are available with AC or DC power options. A variety of liner, electrode & construction materials are available to build units for water, waste water, food & pharmaceutical applications as well as units for the mining & mineral processing industries for the handling of slurries & corrosive fluids.</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Pipe diameters DN3 to DN3000</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Minimum conductivity of process fluid 5 uS/cm</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Measures flow velocities from 0.2 to 15 m/sec</font></span></p><p><span style="font-size: 18px;"><font color="#085294"> Accuracy, standard +/-0.5%. Optional +/-0.3% or +/-0.2%</font></span></p>'),
