(73, 98, '<p><font color="#085294"><span style="font-size: 14px;">Full Pattern Wafer Check Valve features a robust thermoplastic construction with industry leading flow rates and eliminates the need for spacers or specialty flanges.</span></font></p><p><font color="#085294"><span style="font-size: 14px;">The unique angle seat and disk seat allow for high flow rates and excellent sealing properties.</span></font></p><p><font color="#085294"><span style="font-size: 14px;">Available in 2" to 8", all 150 PSI (10 BAR).PVC and CPVC available.</span></font></p><p><font color="#085294"><span style="font-size: 14px;">Other Options:</span></font></p><p><font color="#085294"><span style="font-size: 14px;">- 316 Stainless Steel or Hastaloy Disk Spring </span></font></p><p><span style="font-size: 14px; color: rgb(8, 82, 148);">Contact us for pricing of these options.</span><br></p>'),
(74, 151, '<p><font color="#085294"><span style="font-size: 14px;">Budget Wafer Check Valve, Thermoplastic Construction.</span></font></p><p><font color="#085294"><span style="font-size: 14px;">Available in PVC and CPVC, EPDM or Viton seals</span></font></p><p><font color="#085294"><span style="font-size: 14px;">Sizes 1 1/2" to 20" available</span></font></p><p><font color="#085294"><span style="font-size: 14px;">May require specialty flange or spacer for full flow rate</span></font></p><p><font color="#085294"><span style="font-size: 14px;">Options</span></font></p><p><font color="#085294"><span style="font-size: 14px;">316 Stainless Steel Spring</span></font></p><p><font color="#085294"><span style="font-size: 14px;">Polypropylene of PVDF construction</span></font></p>'),
