(75, 150, '<p>Lab Valves available in 1/4" and 3/8" with EPDM or Viton seals.</p><p>For available options please see attached data sheet.</p><p><a href="http://www.merrimancontrols.com/uploads/category_pdf/Labvalves.pdf">http://www.merrimancontrols.com/uploads/category_pdf/Labvalves.pdf</a> <br></p>'),
